import React, { useEffect, useState } from 'react';

function SchemesExplorer() {
  const [schemes, setSchemes] = useState([]);

  useEffect(() => {
    // axios.get('/api/schemes').then(res => setSchemes(res.data));
    setSchemes([
      { name: 'PM-KISAN', summary: 'Direct income support to farmers.' },
      { name: 'Soil Health Card', summary: 'Provides soil health cards to farmers.' }
    ]);
  }, []);

  return (
    <div className="bg-white p-4 rounded shadow">
      <h2 className="text-xl font-semibold mb-2">Government Schemes</h2>
      <ul className="list-disc ml-6">
        {schemes.map((scheme, i) => (
          <li key={i}><b>{scheme.name}:</b> {scheme.summary}</li>
        ))}
      </ul>
    </div>
  );
}
export default SchemesExplorer;
